Actionscript.script:
if(_parent.技能名 != "寸拳")
{
   _parent.动画完毕();
}
_parent.攻击呐喊();

if (_parent.已使用铁布衫 != true)
{
	var 技能防御力加成 = 0.99 + 0.08 * _parent.技能等级 + Math.min(_parent.内力/7000, 0.1);
	_parent.buff.赋值("防御力","倍率",技能防御力加成,"增益");
	//_parent.防御力 += _parent.技能防御力加成;
	var 加成比例 =  -1 + 8 * _parent.技能等级 + Math.floor(Math.min(_parent.内力/70, 10));
	_root.发布消息("防御力上升" + 加成比例 + "%！目前防御力为" + Math.floor(_parent.防御力) + "点！");
}
_parent.已使用铁布衫 = true;

_parent.刚体控制器.技能等级 = Number(_parent.技能等级);
_parent.刚体控制器.gotoAndPlay("刚体开始");
减伤率 = _parent.技能等级 * 2;
_parent.霸体减伤(减伤率);

_parent.UpdateSmallState("霸体后");

_parent.UpdateBigSmallState("技能中","震地中");
if(_root.技能浮空 == true && _parent._name == _root.控制目标)
{
   if(_parent.Z轴坐标 - _parent._y >= 30)
   {
      this.onEnterFrame = function()
      {
         if(_parent.Z轴坐标 - _parent._y >= 30)
         {
            _parent.垂直速度 += 20;
            _parent._y += _parent.垂直速度;
            if(_parent._y > _parent.Z轴坐标)
            {
               _parent._y = _parent.Z轴坐标;
            }
            stop();
         }
         else
         {
			_parent._y = _parent.Z轴坐标;
            if(_parent.flySpeed > 0)
            {
               _parent.flySpeed = 0;
            }
			落地 = true;
			_parent.浮空 = false;
			_root.技能浮空 = false;
            play();
            delete this.onEnterFrame;
         }
      };
   }
}

if(!_parent.已使用兴奋剂)
{
   _parent.hp -= 10;
   _root.主角hp显示界面.刷新显示();
   //_parent.技能空手攻击力加成 = 10 * _parent.技能等级;
   //_parent.空手攻击力 += _parent.技能空手攻击力加成;
	var 技能空手攻击力加成 =  10 * _parent.技能等级;
	_parent.buff.赋值("空手攻击力", "加算", 技能空手攻击力加成, "增益");

	var 技能速度加成 =  1 + 0.05 * _parent.技能等级;
	_parent.buff.赋值("速度", "倍率", 技能速度加成, "增益");
	/*
   _parent.技能速度加成 = _parent.行走X速度 *  0.05 * _parent.技能等级;
   _parent.行走X速度 *= 1 + 0.05 * _parent.技能等级;
   _parent.行走Y速度 *= 1 + 0.05 * _parent.技能等级;
   _parent.跑X速度 *= 1 + 0.05 * _parent.技能等级;
   _parent.跑Y速度 *= 1 + 0.05 * _parent.技能等级;
   _parent.被击硬直度 /= 2;
   _parent.起跳速度 *= 1 + 0.02 * _parent.技能等级;
   */
   _root.发布消息("已注射兴奋剂，移动速度提升,一个场景内有效。");
}
_parent.已使用兴奋剂 = true;

if(_root.技能浮空 == true  && _parent._name == _root.控制目标)
{
   gotoAndPlay("凶斩跳前摇");
}

组合拳攻击 = _root.技能函数.组合拳攻击;
组合拳重击 = _root.技能函数.组合拳重击;

组合拳攻击(0.5);

凶斩攻击 = _root.技能函数.凶斩攻击;

function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;

	_root.消除子弹(消弹属性);
}

_parent.UpdateSmallState("凶斩刀落");
凶斩攻击(true);
消弹();

瞬步斩攻击 = _root.技能函数.瞬步斩攻击;

function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;

	_root.消除子弹(消弹属性);
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 = _parent._parent.空手攻击力 * 0.2 + 2 * _parent._parent.内力 * (2 + _parent._parent.技能等级 * 1);
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;
	子弹属性.不硬直 = true;

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

