onClipEvent(load){
   if(Key.isDown(_parent._parent.上键))
   {
      _parent.上下跳移动方向 = "上";
      _parent.gotoAndPlay("上下闪现");
   }
   else if(Key.isDown(_parent._parent.下键))
   {
      _parent.上下跳移动方向 = "下";
      _parent.gotoAndPlay("上下闪现");
   }
   if(_parent._parent.方向 == "右")
   {
      if(Key.isDown(_parent._parent.右键) == true)
      {
         _parent.gotoAndPlay("前闪现");
      }
   }
   else if(_parent._parent.方向 == "左")
   {
      if(Key.isDown(_parent._parent.左键) == true)
      {
         _parent.gotoAndPlay("前闪现");
      }
   }
}

onClipEvent(enterFrame){
   var 实际移动距离 = _root.技能函数.小跳移动距离计算("后跳", _parent._parent.技能等级, _parent._parent.重量, _parent._parent.等级);
   _parent.攻击时后退移动(实际移动距离, 实际移动距离);
}
onClipEvent(load){
   if(Key.isDown(_parent._parent.上键))
   {
      _parent.上下跳移动方向 = "上";
      _parent.gotoAndPlay("上下跳");
   }
   else if(Key.isDown(_parent._parent.下键))
