      _parent.上下跳移动方向 = "下";
      _parent.gotoAndPlay("上下跳");
   }
   if(_parent._parent.方向 == "右")
   {
      if(Key.isDown(_parent._parent.右键) == true)
      {
         _parent.gotoAndPlay("前跳");
      }
   }
   else if(_parent._parent.方向 == "左")
   {
      if(Key.isDown(_parent._parent.左键) == true)
      {
         _parent.gotoAndPlay("前跳");
      }
   }
}

onClipEvent(enterFrame){
	if(!_parent.上下跳移动方向){
		if(random(2)==0){
			_parent.上下跳移动方向 = "上";
		}else{
			_parent.上下跳移动方向 = "下";
		}
	}
   var 实际移动距离 = _root.技能函数.小跳移动距离计算("上下跳", _parent._parent.技能等级, _parent._parent.重量, _parent._parent.等级);
   _parent._parent.移动(_parent.上下跳移动方向, 实际移动距离);
   _parent.攻击时移动(0, 实际移动距离);
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 * (1 + _parent._parent.技能等级 * 0.2);
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 0;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

